import React from 'react'

let style = {
    textAlign: 'center',
    width: '100%'
}

const emergencySection = () => (
    <div style={style}>
        <h1>Contact Law Enforcement</h1>
        <i class="fas fa-phone fa-8x"></i>
    </div>
)

export default emergencySection
